import React from "react";
import Head from "next/head";
import FavIcon from "assets/images/fav-icon.png";

const Main = ({
  children,
  title = "Lama | Next gentrations react next landing page",
}) => {
  return (
    <React.Fragment>
      <Head>
        <title>{title}</title>
        <meta name="viewport" content="width=device-width, initial-scale=1" />
        <meta name="Description" content="React next landing page" />
        <meta name="theme-color" content="#ec5555" />
        <link rel="shortcut icon" type="image/x-icon" href={FavIcon} />
        <link
          href="https://fonts.googleapis.com/css2?family=Open+Sans:wght@300;400;600&family=Poppins:wght@200;300;400;500;600;700;800;900&display=swap"
          rel="stylesheet"
        />
      </Head>
      <main>{children}</main>
    </React.Fragment>
  );
};

export default Main;
